import { Link } from "react-router-dom";
import React from 'react';     //necesaria en stackblitz 
function Inicio() {
  return (
    <div className="mt-4 p-5 rounded" style={{ backgroundColor: "lightgray" }}>
      <h1>Gestion Escolar 2024</h1>
      <p>Esta aplicacion de gestion escolar está desarrollado con las siguientes tecnologías:</p>
      <p>
        Backend: NodeJs, Express, Sequelize, Sqlite
        múltiples capas en Javascript.
      </p>
      <p>
        Frontend: Single Page Application, HTML, CSS, Bootstrap, NodeJs,
        Javascript y React.
      </p>
      <Link to="/gestionEscolar" className="btn btn-lg btn-primary">
          <i className="fa fa-search"> </i>  Ver Registros
    </Link>

    </div>
  );
}
export { Inicio };
